    def setUp(self):
        patcher = mock.patch("requests.get")
        self.addCleanup(patcher.stop)
        self.mock_fetch = patcher.start()
        self.mock_fetch.return_value.status_code = 200
        self.mock_fetch.return_value.content = RetrieveImages.FAKE_DATA

    def test_no_arms(self):
        res = ["arm" not in x.abi for x in menu.get_images_info()]
        self.assertTrue(all(res))

    def test_some_arms(self):
        res = ["arm" not in x.abi for x in menu.get_images_info(arm=True)]
        self.assertTrue(any(res))

    def test_has_images(self):
        self.assertGreater(len(menu.get_images_info()), 0)

    def test_finds_p(self):
        images = menu.find_image("P")
        self.assertGreater(len(images), 0)
        for img in images:
            self.assertRegex(str(img), "P")


